import React from 'react';
import classes from "./AndroidBlock3.module.css";






let AndroidBlock3 =(props) => {

    return(
        <div className={classes.blockSmall}>

            <div className={classes.block2Items}>
                <h1 className={classes.h1Block3}>build an android app for any device</h1>
                <span className={classes.textBlock3}> {props.text}Our Mobile Application team is one of the best assets for the development of Android, iOS and Windows phone. You give us an idea and we will craft you in an extraordinary piece of ingenuity, that will perform better than you dream of it.At SparkleAppz we have an experienced team whose expertise lie in making your app a success. </span>
                <div className={classes.figureBlock3}>
                    <figure>
                        <img src={props.img1} alt="foto"/>
                        <figcaption>
                            <h2 className={classes.figcaptionH1}>insta cleaner</h2>
                            <span className={classes.figcaptionSpan}> Clean your instagram by mass deleting and blocking users.</span>
                        </figcaption>
                    </figure>
                    <figure>
                        <img src={props.img2} alt="foto"/>
                        <figcaption>
                            <h2 className={classes.figcaptionH1}>more likes</h2>
                            <span className={classes.figcaptionSpan}>Get instagram likes and followers on your insta page. </span>
                        </figcaption>
                    </figure>
                </div>

            </div>
            <div className={classes.btnFigDiv}> <a href="/portfolio"> <button className={classes.btnFigure}>show more project </button></a> </div>
        </div>
    );




};
export default AndroidBlock3;
